import React from 'react';
import './App.css';
//import {BrowserRouter as Router, Route, Switch, Link, Redirect} from 'react-router-dom';
import Card from 'react-bootstrap/Card';
import ListGroup from 'react-bootstrap/ListGroup';
import ListGroupItem from 'react-bootstrap/ListGroup';
import Navbar from 'react-bootstrap/Navbar';

//Pages
//import MainPage from './pages';


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="navbar">
          <ul>
            <li>Home</li>
            <li>My Patients</li>
            <li>Notifications</li>
            <li>Upload Content</li>
            <li>My Content</li>
            <li>My Profile</li>
          </ul>
        </div>

        <div className="profile-buttons"> 
          <ul>
            <li>Assign</li>
            <li>User Content</li>
            <li>Progress Report</li>
            <li>Contact</li>
          </ul>
        </div>


          <Card className="card" style={{ width: '18rem' }}>
          <Card.Img className="ProPic" variant="top" src="https://fertilitynetworkuk.org/wp-content/uploads/2017/01/Facebook-no-profile-picture-icon-620x389.jpg" alt="cant display image" />
          <Card.Body>
            <Card.Title>Full Name</Card.Title>
            <Card.Text>
              Here is some info about the profile user.
            </Card.Text>
          </Card.Body>
          <ListGroup className="list-group-flush">
            <ListGroupItem>Location: SF, CA</ListGroupItem>
            <ListGroupItem>Age: 15</ListGroupItem>
            <ListGroupItem>*Another Field*: </ListGroupItem>
          </ListGroup>
            <div className="ProfileDescription">
              Here is some optional text, separate div.
            </div>
            <br></br>
          <Card.Body>
            <Card.Link href="#">Card Link</Card.Link>
            <Card.Link href="#">Another Link</Card.Link>
          </Card.Body>
          </Card>

          <>
  <Navbar bg="light">
    <Navbar.Brand href="#home">Brand link</Navbar.Brand>
  </Navbar>
  <br />
  <Navbar bg="light">
    <Navbar.Brand>Brand text</Navbar.Brand>
  </Navbar>
  <br />
  <Navbar bg="dark">
    <Navbar.Brand href="#home">
      <img
        src="/logo.svg"
        width="30"
        height="30"
        className="d-inline-block align-top"
        alt="React Bootstrap logo"
      />
    </Navbar.Brand>
  </Navbar>
  <br />
  <Navbar bg="dark" variant="dark">
    <Navbar.Brand href="#home">
      <img
        alt=""
        src="/logo.svg"
        width="30"
        height="30"
        className="d-inline-block align-top"
      />{' '}
      React Bootstrap
    </Navbar.Brand>
  </Navbar>
</>

      </header>
    </div>
  );
}


export default App;


